&quot;Discoveries&quot; 

TheWhipChamber

Sasha Knox


MP4 + Pics.

Sasha's journey into the depths of her soul via the whip continues as Ogre now stands her upright with her hands cuffed overhead. If her previous session was a confrontation, this session will be an outright discovery. As the lashes start, Ogre now concentrates the power on her front side and Sasha's wails know no boundaries. As painful as it is for her, it is almost apparent that this discovery is something she needs...something therapeutic. And if therapy is what Sasha truly craves, then Ogre is about to hand it out in heavy doses...

